import React from "react";
import emojipedia from "./../emojipedia"

import Card from "./Card";

function createEmojipedia(emojipedia){
  return <Card key= {emojipedia.id} name ={emojipedia.name} emoji = {emojipedia.emoji} meaning ={emojipedia.meaning}  />
}

var numbers = [2, 25, 86, 10, 91]

function double(x){
  return x*2;
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
      {emojipedia.map(createEmojipedia)}
      </dl>

      <h3>Mappings</h3>
      <p> create a new array by doing something with each item of array  </p>
      e.g <span> {numbers.map(double)} </span>

    </div>
  );
}

export default App;
